const ideas = [
    {
        key: 1,
        title: "",
        content:
            ""
    },
    {
        key: 2,
        title: "Home budget",
        content:
            "App to control your own budget with an option to create piggy-banks."
    },
    {
        key: 3,
        title: "Flicker",
        content:
            "Movie storage app with 'to watch' section."
    },
    {
        key: 4,
        title: "Pin Board",
        content:
            "Fully customizable pin board to keep ideas on short notes around pictures and colorfull decorations. "
